def threat_assessment(ego_position, ego_velocity, target_position, target_velocity, safe_reaction_time: float, safe_distance: float):
    """Assess the threat level of collision between ego and target objects.

    Args:
        safe_reaction_time: The (maximal) time it takes for the ego object to react.
        safe_distance: The minimal permissible distance between the ego and target objects.

    Returns:
        approaching_intensity: If approaching, it is the dot product (negative) of relative position and velocity. Otherwise, it is 0.
        threat_index: From 0 (no threat) to 1 (imminent threat).
    """
    ego_position = np.array(ego_position[:2])
    ego_velocity = np.array(ego_velocity[:2])
    target_position = np.array(target_position[:2])
    target_velocity = np.array(target_velocity[:2])
    
    relative_position = target_position - ego_position
    relative_velocity = target_velocity - ego_velocity
    # relative_speed = np.linalg.norm(relative_velocity)

    if np.linalg.norm(relative_position) < safe_distance:
        return -np.inf, 1
    
    approaching_intensity = min(0, np.dot(relative_position, relative_velocity))

    if approaching_intensity >= 0:
        return approaching_intensity, 0
    
    relative_velocity_toward_collision = np.dot(relative_position, relative_velocity) / np.dot(relative_position, relative_position) * relative_position
    relative_speed_toward_collision = np.linalg.norm(relative_velocity_toward_collision)
    
    bestcase_time_to_collision = np.linalg.norm(relative_position) / (relative_speed_toward_collision + 1e-6)
    relax_factor = safe_reaction_time/bestcase_time_to_collision

    threat_index = 1-np.exp(relax_factor*approaching_intensity)
    return approaching_intensity, threat_index

# Example positions
ego_position = [0, 0]
ego_velocity = [0, 0]

target_position = [5, 5]
vt_x = np.linspace(-5, 5, 500)
vt_y = np.linspace(-5, 5, 500)
VX, VY = np.meshgrid(vt_x, vt_y)
values = []
for target_velocity in zip(VX.flatten(), VY.flatten()):
    approaching_intensity, threat_index = threat_assessment(ego_position, ego_velocity, target_position, target_velocity, safe_reaction_time=0.5, safe_distance=1)
    values.append( threat_index )
value_matrix = np.array(values).reshape(VX.shape)

fig, ax = plt.subplots()
ax = cast(Axes, ax)
contourf_ = ax.contourf(target_position[0]-VX, target_position[1]-VY, value_matrix, levels=100)
ax.plot(ego_position[0], ego_position[1], "bo")
ax.plot(target_position[0], target_position[1], "ro")
# add bar to the right of the plot
cbar = fig.colorbar(contourf_)
ax.set_xlabel("X")
ax.set_ylabel("Y")
ax.axis("equal")

plt.show()